import React from 'react';
import logoImage from '../../assets/images/logo.png';

import styles from './Logo.module.css';

const Logo = props => {
  return (
    <div
      className={styles.LogoContainer}
      style={{ padding: props.padding && props.padding }}
    >
      <img src={logoImage} alt="" />
    </div>
  );
};

export default Logo;
